export default class GenericPlant {

      constructor(id, date, position) {
        this.key = id
        this.type = "generic_plant"
        this.growth = 0
        this.bloom = 2
        this.date = date
        this.position = position
        leafColour = '#377F34'
        stemColour = '#499B4A'
        flowerColour = '#832134'
      }
}
